// SecondPage.tsx
import React from 'react';
import { View, Text, Button, StyleSheet } from 'react-native';

interface SecondPageProps {
  navigation: any; // Use the appropriate type for navigation
}

const SecondPage: React.FC<SecondPageProps> = ({ navigation }) => {
  return (
    <View style={styles.container}>
      <View style={styles.circleContainer}>
        <View style={styles.circle}></View>
      </View>
      <View style={styles.content}>
        <Text style={styles.heading}>Welcome to My App!</Text>
        <Text style={styles.subtext}>Get started by exploring our features.</Text>
      </View>
      <Button
        title="Go Back"
        onPress={() => navigation.goBack()}
        color="yellow" // Set the button color to yellow
      />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'red',
    justifyContent: 'center',
    alignItems: 'center',
  },
  circleContainer: {
    position: 'absolute',
    top: 30,
    right: 5,
    width: 100,
    height: 100,
    justifyContent: 'center',
    alignItems: 'center',
  },
  circle: {
    width: 400,
    height: 400,
    borderRadius: 200,
    backgroundColor: 'grey',
  },
  content: {
    justifyContent: 'flex-start',
    alignItems: 'flex-start',
    marginLeft: 20,
    marginTop: 20,
  },
  heading: {
    fontSize: 24,
    fontWeight: 'bold',
    color: 'white',
    marginBottom: 10,
    textAlign: 'left', // Align text to the left
  },
  subtext: {
    fontSize: 16,
    color: 'white',
    marginBottom: 20,
    textAlign: 'left', // Align text to the left
  },
  buttonContainer: {
    alignSelf: 'flex-start', // Align the button to the left
  },
  goBackButtonContainer: {
    alignSelf: 'flex-start', // Align the "Go Back" button to the left
    marginLeft: 20, // Add left margin for alignment
  },
});


export default SecondPage;
